import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import Preloader from './Preloader';
import '../assets/css/LoR.css';

const LorR = () => {
  const [tab, setTab] = useState('sign-in');
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    age: '',
    gender: 'male',
    familyBackground: 'rich',
    goals: '',
    currentStatus: '',
    phone: '',
  });
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      let response;
      if (tab === 'sign-up') {
        response = await axios.post('http://localhost:4000/register', formData, { withCredentials: true });
      } else {
        response = await axios.post('http://localhost:4000/login', formData, { withCredentials: true });
      }
      const res = response.data;
      if (res.status === true) {
        navigate('/welcome');
      } else {
        alert(res.message);
        if (tab === 'sign-up') {
          setFormData({
            name: '',
            email: '',
            password: '',
            age: '',
            gender: 'male',
            familyBackground: 'rich',
            goals: '',
            currentStatus: '',
            phone: '',
          });
        } else {
          setFormData({ ...formData, password: '' });
        }
      }
    } catch (ex) {
      console.log(ex);
    }
  };

  return (
    <div>
      <Preloader />
      <div className="login-wrap">
        <div className="login-html">
          <input
            id="tab-1"
            type="radio"
            name="tab"
            value="sign-in"
            className="sign-in"
            checked={tab === 'sign-in'}
            onChange={() => setTab('sign-in')}
          />
          <label htmlFor="tab-1" className="tab">
            Sign In
          </label>
          <input
            id="tab-2"
            type="radio"
            name="tab"
            value="sign-up"
            className="sign-up"
            checked={tab === 'sign-up'}
            onChange={() => setTab('sign-up')}
          />
          <label htmlFor="tab-2" className="tab">
            Sign Up
          </label>
          <div className="login-form">
            <div className={`sign-in-htm ${tab === 'sign-in' ? 'active' : ''}`}>
              <h2>Login</h2>
              <form onSubmit={handleSubmit}>
                <div className="group">
                  <label htmlFor="username" className="label">
                    Username
                  </label>
                  <input type="text" id="username" name="name" className="input" value={formData.name} onChange={handleChange} />
                </div>
                <div className="group">
                  <label htmlFor="password" className="label">
                    Password
                  </label>
                  <input type="password" id="password" name="password" className="input" value={formData.password} onChange={handleChange} />
                </div>
                <div className="group">
                  <input type="submit" className="button" value="Sign In" />
                </div>
              </form>
            </div>
            <div className={`sign-up-htm ${tab === 'sign-up' ? 'active' : ''}`}>
              <h2>Register</h2>
              <form onSubmit={handleSubmit}>
                {/* Add registration form fields here */}
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LorR;
